// Maps ICAO aircraft type description codes (e.g. "L2J") to aircraft icons. This is used if the ICAO type designator (e.g. "B731")
// cannot be found in the TypeDesignatorIcons mappings. The key can be one of the following:
//   - Single character: The basic aircraft type letter code (e.g. "H" for helicopter).
//   - Three characters: The ICAO type description code (e.g. "L2J" for landplanes with 2 jet engines).
//   - Five characters: The ICAO type description code concatenated with the wake turbulence category code, separated by
//     a dash (e.g. "L2J-M").

var TypeDescriptionIcons = {
        'H': 'helicopter',

        'L1P': 'cessna',
        'L1T': 'cessna',
        'L1J': 'hi_perf',

        'L2P': 'twin_small',
        'L2T': 'twin_large',

        'L2J-L': 'jet_swept',
        'L2J-M': 'airliner',
        'L2J-H': 'heavy_2e',

        'L4T': 'heavy_4e',
        'L4J-H': 'heavy_4e'
};

var CategoryIcons = {
        "A1" : 'cessna',

        "A2" : 'jet_nonswept',

        "A3" : 'airliner',

        "A5" : 'heavy_4e',

        "A7" : 'helicopter',

        "B2" : 'balloon',

        'C0' : 'ground_unknown',

        'C1' : 'ground_emergency',

        'C2' : 'ground_service',

        'C3' : 'ground_fixed'
};
//Start CJS Change
function getBaseMarker(category, typeDesignator, typeDescription, wtc, icao, spd, alt, emitter) {
//End CJS Change
//Start CJS Add
        if (emitter && $('#emitter_checkbox').hasClass('settingsCheckboxChecked') )
                {
                    return shapes[TypeDesignatorIcons["EMT"]];
                }

        if (interestArrayICAO.includes(icao))
        {
            // Use to identify any airplanes of interest and forward the appropriate SVG symbol
            var ind = interestArrayICAO.indexOf(icao);
            if (interestArraychk[ind] == "Yes")
            {
                if ($('#emitter_checkbox').hasClass('settingsCheckboxChecked'))
                {
                    return shapes[TypeDesignatorIcons[interestArraysymb[ind]]];
                }
            }
            else
            {
                return shapes[TypeDesignatorIcons[interestArraysymb[ind]]];
            }
        } 
                        
//End CJS Add
        if (typeDesignator in TypeDesignatorIcons) {
                return shapes[TypeDesignatorIcons[typeDesignator]];
        }

        if (typeDescription !== undefined && typeDescription !== null && typeDescription.length === 3) {
                if (wtc !== undefined && wtc !== null && wtc.length === 1) {
                        var typeDescriptionWithWtc = typeDescription + "-" + wtc;
                        if (typeDescriptionWithWtc in TypeDescriptionIcons) {
                                return shapes[TypeDescriptionIcons[typeDescriptionWithWtc]];
                        }
                }

                if (typeDescription in TypeDescriptionIcons) {
                        return shapes[TypeDescriptionIcons[typeDescription]];
                }

                var basicType = typeDescription.charAt(0);
                if (basicType in TypeDescriptionIcons) {
                        return shapes[TypeDescriptionIcons[basicType]];
                }
        }

        if (category in CategoryIcons) {
                return shapes[CategoryIcons[category]];
        }

//Start CJS Add

        if  (icao.charAt(0) == "~" && 
             ((alt < 9000.0 && spd > 340.0) || 
              (alt < 7000.0 && spd > 310.0) || 
              (alt < 5000.0 && spd > 280.0) ||
              (alt < 3000.0 && spd > 240.0) 
            ))  {
               // Low and fast; must be a fighter jet
               typeDescription = 'FTR';
               return shapes[TypeDesignatorIcons[typeDescription]];
        }
//End CJS Add

        return shapes['unknown'];
}

function svgPathToSvg(path, stroke, fill, selected_stroke) {
        path = path.replace('aircraft_color_fill', fill).replace('aircraft_color_stroke', stroke).replace('add_stroke_selected', selected_stroke);
        return path;
}


function svgPathToURI(path, stroke, fill, selected_stroke) {
        return "data:image/svg+xml;base64," + btoa(svgPathToSvg(path, stroke, fill, selected_stroke));
}
